import React from "react";

const Header = ({ cartCount }) => {
  return (
    <div className="header-contents">
      <h1>My Shoping</h1>
      <div>
        <div className="cart-icon">Cart: {cartCount}</div>
        <i className="fa-solid fa-cart-shopping" style={{ color: "black" }}></i>
      </div>
    </div>
  );
};

export default Header;
